import Lottie from "react-lottie";

const Loading = () =>{
    const defaultOptions = {
        loop: true,
        autoplay: true,
        animationData: loading,
        rendererSettings: {
            preserveAspectRatio: 'xMidYMid slice'
        }
    };
    return(
        <Lottie options={defaultOptions} height={150}
                        width={150} />
    )
}


export default Loading
